function initJoystick() {

    var body = document.querySelector('body');
    // console.log(body);
    var canvas = '<canvas id="joystick" height="300" width="300"></canvas>';
    var box = document.createElement('div');
    box.setAttribute('id', 'joystickBox');
    box.innerHTML = canvas;
    var buttonA = `<div class='buttonA button'>A</div>`
    var buttonB = `<div class='buttonB button'>B</div>`
    var buttonC = `<div class='buttonC button'>C</div>`
    var buttonD = `<div class='buttonD button'>D</div>`
    var buttonE = `<div class='buttonE button'>投币</div>`
    var buttonF = `<div class='buttonF button'>开始</div>`
    body.append(box);
    $("#joystickBox").append(buttonA)
    $("#joystickBox").append(buttonB)
    $("#joystickBox").append(buttonC)
    $("#joystickBox").append(buttonD)
    $("#joystickBox").append(buttonE)
    $("#joystickBox").append(buttonF)

    
    var css = `
    .button {
        width: 80px;
        height: 80px;
        background-color: red;
        text-align: center;
        line-height: 80px;
        position:fixed;
    }
    .buttonA {
        right: 150px;
        bottom: 50px;
    }
    .buttonB {
        right: 30px;
        bottom: 50px;
    }
    .buttonC {
        right: 150px;
        bottom: 150px;
    }
    .buttonD {
        right: 30px;
        bottom: 150px;
    }
    .buttonE {
        right: 150px;
        bottom: 250px;
    }
    .buttonF {
        right: 30px;
        bottom: 250px;
    }

    #joystick {
        height: 200px;
        width: 200px;
        border-radius: 200px;
        -moz-border-radius: 200px;
        -webkit-border-radius: 200px;
        text-align: center;
        background-color: #80d5ff;
        font: 24px/300px Helvetica, Arial, sans-serif;
        cursor: all-scroll;
        user-select: none;
        z-index: 10;
        position: fixed;
        left: 50px;
        bottom: 50px;
    }
    `
    
    $('.buttonA').click(function(){
        EMUInputBridge.keyPress(EMUInputIndex.P1_A);
        console.log('A')
    })
    $('.buttonB').click(function(){
        EMUInputBridge.keyPress(EMUInputIndex.P1_B);
        console.log('B')
    })
    $('.buttonC').click(function(){
        EMUInputBridge.keyPress(EMUInputIndex.P1_C);
        console.log('C')
    })
    $('.buttonD').click(function(){
        EMUInputBridge.keyPress(EMUInputIndex.P1_D);
        console.log('D')
    })
    $('.buttonE').click(function(){
        EMUInputBridge.keyPress(EMUInputIndex.P1_Coin);
        console.log('投币')
    })
    $('.buttonF').click(function(){
        EMUInputBridge.keyPress(EMUInputIndex.P1_Start);
        console.log('开始')
    })

    var style = document.createElement("STYLE");
    style.innerText = css;
    document.body.appendChild(style);
    
    
	// easal stuff goes hur
	var xCenter = 150;
	var yCenter = 150;
	var stage = new createjs.Stage("joystick");

	var psp = new createjs.Shape();
	psp.graphics.beginFill("#333333").drawCircle(xCenter, yCenter, 50);

	psp.alpha = 0.25;

	var vertical = new createjs.Shape();
	var horizontal = new createjs.Shape();
	vertical.graphics.beginFill("#ff4d4d").drawRect(150, 0, 2, 300);
	horizontal.graphics.beginFill("#ff4d4d").drawRect(0, 150, 300, 2);

	stage.addChild(psp);
	stage.addChild(vertical);
	stage.addChild(horizontal);
	createjs.Ticker.framerate = 60;
	createjs.Ticker.addEventListener("tick", stage);
	stage.update();

	var myElement = $("#joystick")[0];

	// create a simple instance
	// by default, it only adds horizontal recognizers
	var mc = new Hammer(myElement);

	mc.on("panstart", function(ev) {
		var pos = $("#joystick").position();
		xCenter = psp.x;
        yCenter = -psp.y;
		psp.alpha = 0.5;

		stage.update();
	});

	// listen to events...
	mc.on("panmove", function(ev) {
        var pos = $("#joystick").position();
        
        var coords = calculateCoords(ev.angle, ev.distance);        

        var base = 0.375;
        if(coords.rads >= -1*base && coords.rads < 1*base) {
            EMUInputBridge.right();

            console.log('right')
        }
        if(coords.rads >= 1*base && coords.rads < 3*base) {
            EMUInputBridge.downRight();

            console.log('bottom right')
        }
        if(coords.rads >= 3*base && coords.rads < 5*base) {
            EMUInputBridge.down();

            console.log('bottom')
        }
        if(coords.rads >= 5*base && coords.rads < 7*base) {
            EMUInputBridge.downLeft();

            console.log('bottom left')
        }
        if(coords.rads >= 7*base || coords.rads < -7*base) {
            EMUInputBridge.left();

            console.log('left')
        }
        if(coords.rads >= -7*base && coords.rads < -5*base) {
            EMUInputBridge.upLeft();

            console.log('top left')
        }
        if(coords.rads >= -5*base && coords.rads < -3*base) {
            EMUInputBridge.up();

            console.log('top')
        }
        if(coords.rads >= -3*base && coords.rads < -1*base) {
            EMUInputBridge.upRight();

            console.log('top right')
        }


		psp.x = coords.x;
		psp.y = -coords.y;

		psp.alpha = 0.5;
		stage.update();
	});

	mc.on("panend", function(ev) {
        psp.alpha = 0.25;
		createjs.Tween.get(psp).to(
			{ x: xCenter, y: yCenter },
			750,
			createjs.Ease.elasticOut
        );
        
        EMUInputBridge.resetJoy();
        console.log('reset position')
	});
}

function calculateCoords(angle, distance) {
	var coords = {};
	distance = Math.min(distance, 100);
	var rads = (angle * Math.PI) / 180.0;

	coords.x = distance * Math.cos(rads);
    coords.y = -distance * Math.sin(rads);
    coords.rads = rads

	return coords;
}

initJoystick()
